package main

import "fmt"

const Input = ""
const MarkerLength = 14

func check(e error) {
	if e != nil {
		panic(e)
	}
}

func main() {
	for i := MarkerLength; i <= len(Input); i++ {
		part := Input[i-MarkerLength : i]

		fmt.Printf("%v:", part)

		// find duplicates
		set := map[int32]bool{}

		duplicate := int32(-1)
		for _, c := range part {
			if _, ok := set[c]; ok {
				duplicate = c
				break
			}
			set[c] = true
		}

		if duplicate > 0 {
			fmt.Printf(" found %c\n", duplicate)
		} else {
			fmt.Printf("%d\n", i)
			break
		}

	}
}
